import { useState } from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';
import TabPanel from './TabPanel';
import PriceTable from './NFTs/PriceTable';
import Sales from './Sales';

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}

const RacaTabs = () => {
    const [value, setValue] = useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <Box sx={{ width: '100%' }}>
            <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                <Tabs id='tabs' value={value} onChange={handleChange} aria-label="basic tabs example">
                    <Tab label="NFTs" {...a11yProps(0)} />
                    <Tab label="Sales" {...a11yProps(1)} />
                    <Tab label="Metamon" {...a11yProps(2)} />
                </Tabs>
            </Box>
            <TabPanel value={value} index={0}>
                <PriceTable/>
            </TabPanel>
            <TabPanel value={value} index={1}>
                <Sales/>
            </TabPanel>
            <TabPanel value={value} index={2}>
                Item Three
            </TabPanel>
        </Box>
    );
}

export default RacaTabs;
